import axios from 'axios';

const SortenUrlHelpers = {
    getShortenUrl: async function () {
        let allShortenUrls = [];
        console.log("pappu");

        const response = await axios.get('http://localhost:4000/allShortenUrls').then(res => {
            console.log("res: ", res);
            const { shortenUrls } = res.data || [];
            console.log("shortenUrls: ", shortenUrls);
            allShortenUrls = shortenUrls;
            return allShortenUrls;
        });

        //console.log("shortenUrls-jhjkldhsgj dkfjdjf", shortenUrls);


    }
};

export default SortenUrlHelpers;
